import React, { Component } from 'react'

export default class App extends Component {
    componentDidMount(){
        console.log('App mounted');
    }

    componentWillUnmount(){
        console.log('App unmoounted');
    }

    render() {
        console.log('App rendered');
        return (
            <div>
                 <h1>Hello App component</h1>
            </div>
        )
    }
}
